    static {
        String stationNames = StationUtil.getStationNamesStr();
        for (String stationStr : stationNames.split("@")) {
            if (stationStr != null && stationStr.trim().length() > 0) {
                String[] stationInfo = stationStr.split("\\|");
                hashMap.put(stationInfo[2], stationInfo[1]);    // k-对应stationCode v-对应stationName
            }
        }
    }

